import React, {Component} from "react";
import {Text, View, Image, Dimensions, ImageBackground,StyleSheet} from "react-native";
import {Grid, Col, Row} from "react-native-easy-grid";
const {height, width} = Dimensions.get("window");
import {DashedProgress} from 'react-native-dashed-progress';
const Compasss =(props) => {
 
 

  


  

  _direction = degree => {
    if (degree >= 22.5 && degree < 67.5) {
      return "NE";
    } else if (degree >= 67.5 && degree < 112.5) {
      return "E";
    } else if (degree >= 112.5 && degree < 157.5) {
      return "SE";
    } else if (degree >= 157.5 && degree < 202.5) {
      return "S";
    } else if (degree >= 202.5 && degree < 247.5) {
      return "SW";
    } else if (degree >= 247.5 && degree < 292.5) {
      return "W";
    } else if (degree >= 292.5 && degree < 337.5) {
      return "NW";
    } else {
      return "N";
    }
  };

 
    return (

      <Grid >
      <ImageBackground source={require('../images/safaa.png')} style={styles.action}>
      
      <Row style={{alignItems: "center"}} size={2}>
          

          <Col style={{alignItems: "center"}}>
     
          
          <ImageBackground
     
              source={require("../images/DRTTT.png")}
              style={{
               
                height: width - 80,
                ///justifyContent: "center",
               /// alignItems: "center",
               resizeMode: "contain",
                marginTop:"12%",
                
                //marginLeft:20,
                transform: [
                  {rotate:180+ "deg"},
                ],
              }}
            >
            <View style={{justifyContent: 'center', alignItems: 'center',marginTop:"17%",
            transform: [
              {rotate:-180+ "deg"},
            ],
          }}>
            <View  style={{marginTop:50}}>
            <DashedProgress

fill={props.dataa} //30%  50*30/100
countBars={50} 
radius={62}
indicatorWidth={35}
barWidth={15}
strokeThickness={5}
text={props.dataa+"Km/h"}

showIndicator={false}
trailColor="#8EBCE4"
strokeColor="#3D57A7"
tooltipSize={19}



/>
</View>

   </View>
   </ImageBackground>
             </Col>
        </Row>
              
              
        </ImageBackground>
        </Grid>
    );
   
  }
export default Compasss;
const styles = StyleSheet.create({
  action: {
  // marginTop:110,
  //marginLeft:56,
   width:320,
    position:"absolute",
   //height:450
 }})
